    was written to guide management on Wapack National Wildlife Refuge for the next
    15 years. This plan outlines the Refuge vision and purpose and describes how the
    Refuge will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP planning process, a summary
    of Refuge resources, goals and objectives, information about the management direction,
    strategies for implementation, and a description of Refuge biology and habitats.",nt"license_title":
